function CoolCounter(){
    let count = 0

    const increaseCount = () => {
        count++
    }
    const decreaseCount = () => {
        count++
    }
    return (
        <div>
           <h1>{count}</h1>
           <button onClick={increaseCount}>Decrease</button>
           <button onClick={decreaseCount}>Increase</button>
        </div>
    )
}

export default CoolCounter
